(2278, NULL, 96, 64, NULL, 'Kesan\r\n\r\nSelama mengikuti kegiatan ini, saya merasa sangat senang dan mendapatkan banyak pengalaman berharga. Selain ilmu pengetahuan, saya juga belajar tentang kerja sama, tanggung jawab, dan kekompakan. Semua ini memberikan kesan mendalam yang akan selalu saya ingat.\r\n\r\nPesan\r\n\r\nSemoga kegiatan seperti ini dapat terus dilaksanakan di masa mendatang dengan persiapan yang lebih baik, sehingga manfaat yang diperoleh semakin maksimal. Saya juga berharap hubungan baik yang terjalin di antara guru, teman, maupun panitia dapat selalu terjaga.', '0.00', '2025-08-31 15:08:53', '2025-08-31 15:08:53'),
